import './App.css';
import {Grid, Table, TableCell, TableHead, TableRow} from "@material-ui/core";

function App() {
	return (
		<Grid
			xs={12}
			sm={12}
			lg={12}
			md={12}
			item
			container
		>
			<Table>
				<TableHead>
					<TableRow>
						<TableCell>

						</TableCell>
					</TableRow>
				</TableHead>
			</Table>
		</Grid>
	);
}

export default App;
